import React, {useState, useEffect} from 'react'

function App() {
  const [time, setTime] = useState(0)

  useEffect(() => {
    fetch("/time").then(res => res.json()).then(data => {
      setTime(data.time)
    })
  }, [])
  return (
    <div>
      <form>
        <input type="file" />
      </form>
    </div>
  );
}

export default App;
